private FileStatus cloneStatus() throws IOException {
  return new FileStatus(status.getLen(),
      status.isDirectory(),
      status.getReplication(),
      status.getBlockSize(),
      status.getModificationTime(),
      status.getAccessTime(),
      null, null, null,
      status.isSymlink() ? status.getSymlink() : null,
      status.getPath());
}
